window.bookSummaryJSON = "<p><b>Four amazing novels</b></p> <p>Immerse yourself in a world of strong men and the beautiful women who adore them.</p> <p>From Dragon Lords and Greek Gods to Dungeon Masters and Barbarian Kings. Whether you're an avid harem fan or just want to spice up your sci-fi and fantasy habit, <i>Dangerous Playmates</i> from Black Forge Books brings battle babes and bad boys together in an explosive boxed set you'll listen to again and again. You’ll get four amazing novels from three best-selling authors, and you might just find your next favorite series!</p> <p>Included in this boxed set:</p> <p><i>Denver Fury: American Dragons, Book 1 </i>by Aaron Crash</p> <p><i>Dungeon Bringer 1</i> by Nick Harrow</p> <p><i>War God’s Mantle: Ascension</i> by Aaron Crash and James Hunter</p> <p><i>Barbarian Outcast: Princesses of the Ironbound 1</i> by Aaron Crash</p>"; 
